import styled from 'styled-components';

const Wrapper = styled.div`
  font-family: 'Lato';
  font-size: 1.4rem;
  font-weight: 400;
  line-height: 1.5;
  color: #292b2c;
`;

const Content = styled.div`
  display: block;
`;

export { Content, Wrapper };
